// verzoegert die resize-functionen auf NACH resizen
var waitForFinalEvent = (function(){
	var timers = {};
	return function(callback, ms, uniqueId){
		if(!uniqueId){
			uniqueId = "Don't call this twice without a uniqueId";
		}
		if(timers[uniqueId]){
			clearTimeout(timers[uniqueId]);
		}
		timers[uniqueId] = setTimeout(callback, ms);
	};
})();

function addTeaserClickevents() {
	/* src:https://inclusive-components.design/cards/ */
	const teasers = document.querySelectorAll('.teaser, .searchresult li');
	Array.prototype.forEach.call(teasers, teaser => {
		let down, up, link = teaser.querySelector('h2 a');
		teaser.onmousedown = () => down = +new Date();
		teaser.onmouseup = (e => {
			up = +new Date();
			if ((up - down < 200)  && e.target.tagName != "A" && e.target.parentElement.tagName != "A") {
				let teaserImageContainer = e.target.closest('.image-container');
				let teaserImageOuter = e.target.closest('.teaser').querySelector(".teaserimage");
				let playerURL = e.target.closest('.teaser').dataset.video;
				let teaserImageWidth = teaserImageOuter.offsetWidth;
				let teaserImageHeight = teaserImageOuter.offsetHeight;
				let topTeaser = e.target.closest('.topteaser');

				if ( playerURL !== undefined && teaserImageWidth > 350 && e.target.classList.contains('ndricon_play') ) {
					if ( topTeaser !== null ) {
						let teaserpadding = topTeaser.getElementsByClassName('teaserpadding')[0];
						teaserpadding.classList.add('topteaser-inlineplay');
					}

					let playerEmbed = document.createElement('iframe');
					playerEmbed.classList.add('teaser-inlineplay');
					playerEmbed.setAttribute('src', playerURL);
					teaserImageContainer.classList.add('hideme');
					teaserImageOuter.style.minHeight = teaserImageHeight+'px';
					teaserImageOuter.appendChild(playerEmbed);
				} else {
					link.click();
				}
			}
		})
		teaser.style.cursor = 'pointer';
	});
}

function slideshowpreload(el){
	var myindex = el.index();
	var nextel = el.next();
	if(myindex == 1){
		var num = el.parent().find("li").length - 2;
		var prevel = el.parent("ul").find("li:eq(" + num + ")");

	}
	else{
		var prevel = el.prev();
	}

	var currsrc = el.find("img").attr("src");
	var currlarge = el.find("img").attr("data-large");
	var nextelsrc = nextel.find("img").attr("src");
	var nextellarge = nextel.find("img").attr("data-large");
	var prevelsrc = prevel.find("img").attr("src");
	var prevellarge = prevel.find("img").attr("data-large");

	if(nextelsrc != nextellarge){
		nextel.find("img").attr("src", nextel.find("img").attr("data-large"));
	}
	if(prevelsrc != prevellarge){
		prevel.find("img").attr("src", prevel.find("img").attr("data-large"));
	}
}


function equalheight(elements){
	var targetheight = 0;

	$(elements).each(function(){
		if($(this).outerHeight()>targetheight){
			targetheight = $(this).outerHeight();
		}
	})

	$(elements).css({
		"box-sizing" : "border-box",
		"height" : targetheight
	});
}

function columnize(obj){
	if(!$.browser.msie || $.browser.version>=10){
		obj.css("width", "100%");
		return;
	}
	var totalheight = obj.height();
	if(obj.hasClass("w25")){
		var columncount = 4;
	}
	else if(obj.hasClass("w33")){
		var columncount = 3;
	}
	else if(obj.hasClass("w50")){
		var columncount = 2;
	}
	else{
		return;
	}

	var targetheight = totalheight/columncount - 5;

	var cache = obj.find("> *");

	obj.empty();

	var count = 0;

	for(i = 0; i<columncount; i++){
		var thiscolumn = obj.clone().insertBefore(obj);

		while(thiscolumn.find("> *").length<cache.length/columncount && count<cache.length){
			thiscolumn.append(cache[count]);
			count = count + 1;
		}

	}
}

